import './App.css';
import Hero from './Components/Hero/Hero';
import Navbar from './Components/Navbar/Navbar';
import About from './Components/About/About';
import Services from './Components/Services/Services';

function App() {
  return (
    <div className="App">
       <Navbar/>
       <Hero/>
       <About/>
       <Services/>
       <MyWork/>
    </div>
  );
}

export default App;
